  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0112269 includes chemical,
  discrete sample, physical and profile data collected from MIRAI in the North Pacific
  Ocean and South Pacific Ocean from 2007-02-16 to 2007-03-26 and retrieved during
  cruise MR07-01 and PACIFICA_49NZ20070216. These data include ALKALINITY, AMMONIUM,
  DISSOLVED INORGANIC CARBON, DISSOLVED OXYGEN, HYDROSTATIC PRESSURE, NITRATE, NITRITE,
  PHOSPHATE, SALINITY, SILICATE, WATER TEMPERATURE and pH. The instruments used to
  collect these data include CTD, Coulometer for DIC measurement and bottle. These
  data were collected by Masahide Wakita and Kazuhiko Matsumoto of Japan Agency for
  Marine-Earth Science and Technology (Jamstec) as part of the PACIFICA_49NZ20070216
  data set.nnPACIFICA (PACIFic ocean Interior CArbon) was an international collaborative
  project for the data synthesis of ocean interior carbon and its related parameters
  in the Pacific Ocean. The North Pacific Marine Science Organization (PICES), Section
  of Carbon and Climate (S-CC) supported the project.\",\n\t\"license_title\": null,\n\t\"extras\":
